CREATE TABLE category (category_id integer primary key,
                                 name varchar(40));

CREATE TABLE IF NOT EXISTS channel (
    channel_id INT PRIMARY KEY,
    name VARCHAR(25),
    image VARCHAR(110),
    color VARCHAR(6),
    tagline VARCHAR(250),
    siteurl VARCHAR(60),
    channeltype VARCHAR(200)
);


CREATE TABLE program(
                program_id INT PRIMARY KEY,
                name VARCHAR(100),
                tagline VARCHAR(550),
                email VARCHAR(100),
                url VARCHAR(200),
                editor VARCHAR(50),
                channel INT REFERENCES channel(channel_id),
                category INT REFERENCES category(category_id));

